In good times and bad, what are the hallmarks of a strong company?

@nicolewalters, CEO and founder of @inheritlearning, chats with Georgene Huang and Romy Newman, co-founders of @fairygodboss, about the importance of having strong, cohesive leadership.

(Brought to you by @delltech)

@outerbanksboilco has been serving seafood boils for nearly a decade, but its original purpose wasn’t to feed anyone. It was just to get Matt Khouri a good grade in college. The concept began as a senior project, which Khouri didn’t think would work in the real world — but it had more potential than he imagined. Since opening its first brick-and-mortar in 2016, the company has grown to three corporate locations, and in 2020 the seafood catering-and-takeout business started pursuing franchise-driven growth. The concept turned out to be perfectly suited for the pandemic, thanks to its small real estate footprint and carryout and catering-only options. That helped stores continue operating on a 30 percent profit margin. Now that the company has sold five franchise locations, Khouri reflects upon the hectic year, and what’s in store for the future. Link in bio.
